css:
/*
  FONT
____________________________________________________________________
*/
@font-face {
  font-family: 'Fira Code';
  font-style: normal;
  font-weight: 100;
  src: url("atom://ergonomicon-syntax/fonts/FiraCode-Light.woff2") format("woff2"), url("atom://ergonomicon-syntax/fonts/FiraCode-Light.woff") format("woff"), url("atom://ergonomicon-syntax/fonts/FiraCode-Light.ttf") format("truetype");
}
@font-face {
  font-family: 'Fira Code';
  font-style: normal;
  font-weight: 400;
  src: url("atom://ergonomicon-syntax/fonts/FiraCode-Regular.woff2") format("woff2"), url("atom://ergonomicon-syntax/fonts/FiraCode-Regular.woff") format("woff"), url("atom://ergonomicon-syntax/fonts/FiraCode-Regular.ttf") format("truetype");
}
@font-face {
  font-family: 'Fira Code';
  font-style: normal;
  font-weight: 500;
  src: url("atom://ergonomicon-syntax/fonts/FiraCode-Medium.woff2") format("woff2"), url("atom://ergonomicon-syntax/fonts/FiraCode-Medium.woff") format("woff"), url("atom://ergonomicon-syntax/fonts/FiraCode-Medium.ttf") format("truetype");
}
@font-face {
  font-family: 'Fira Code';
  font-style: normal;
  font-weight: 700;
  src: url("atom://ergonomicon-syntax/fonts/FiraCode-Bold.woff2") format("woff2"), url("atom://ergonomicon-syntax/fonts/FiraCode-Bold.woff") format("woff"), url("atom://ergonomicon-syntax/fonts/FiraCode-Bold.ttf") format("truetype");
}
/*
  EDITOR
____________________________________________________________________
*/
atom-text-editor,
:host {
  font-family: 'Fira Code', Consolas, monospace;
  color: #b4b4b4;
  background-color: #141419;
}
atom-text-editor .cursor,
:host .cursor {
  color: #c8c864;
}
atom-text-editor .invisible,
:host .invisible {
  color: #b4b4b4;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
/* Active tab */
.tab-bar .tab.active[data-type$="Editor"],
.tab-bar .tab.active[data-type$="Editor"] .title,
.tab-bar .tab.active[data-type="MarkdownPreviewView"],
.tab-bar .tab.active[data-type="MarkdownPreviewView"] .title {
  color: #b4b4b4 !important;
  background-color: #141419 !important;
}
.tab-bar .tab.active[data-type$="Editor"]:after,
.tab-bar .tab.active[data-type="MarkdownPreviewView"]:after {
  border-bottom-color: #141419 !important;
}
/* Scrollbar */
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-corner,
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-track {
  background-color: #141419 !important;
}
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-thumb {
  border-color: #141419 !important;
}
/*
  GUIDE
____________________________________________________________________
*/
atom-text-editor::shadow .wrap-guide,
:host::shadow .wrap-guide,
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #1f1f27;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #1f1f27;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #141419;
}
/*
  GUTTER
____________________________________________________________________
*/
atom-text-editor .gutter,
:host .gutter {
  color: #414152;
  background-color: #141419;
}
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded {
  color: ;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #b4b4b4;
  background-color: #1f1f27;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #b4b4b4;
}
/*
  SELECTION
____________________________________________________________________
*/
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #80808a;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: #80808a;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  color: #c8c864;
  border: 1px solid #c8c864;
}
/*
  TYPOGRAPHY
____________________________________________________________________
*/
atom-text-editor {
  -webkit-font-feature-settings: "liga" on, "calt" on;
  text-rendering: optimizeLegibility;
}
atom-text-editor::shadow .string.quoted,
atom-text-editor::shadow .string.regexp {
  -webkit-font-feature-settings: "liga" off, "calt" off;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
/*
  CORE
____________________________________________________________________
*/
.none {
  color: #b4b4b4;
}
.punctuation {
  color: inherit !important;
}
.comment {
  color: #414152;
}
.keyword {
  color: #ff9696;
}
.constant {
  color: #fa9664;
}
.variable {
  color: rgba(150, 200, 255, 0.8);
}
.string {
  color: rgba(220, 120, 255, 0.5);
  font-weight: 100;
}
.storage {
  color: #ff78dc;
}
.illegal.invalid {
  color: #c8c864;
}
.support {
  color: #64c864;
}
.entity {
  color: rgba(150, 200, 255, 0.8);
}
/*
  SPECIFICS
____________________________________________________________________
*/
.modifier {
  color: rgba(48, 147, 255, 0.8);
}
.control {
  color: #64c864;
  font-weight: 700;
}
.primitive {
  color: #64c8c8;
  font-weight: 700;
}
.elements {
  color: #b4b4b4;
}
/* Methods */
.method-call .method {
  color: rgba(150, 200, 255, 0.8);
  font-weight: 500;
}
.method-parameters {
  color: #b4b4b4;
  font-weight: 100;
}
/*
  JAVA
____________________________________________________________________
*/
.java .entity {
  text-decoration: underline;
}
.java .storage {
  color: #b4b4b4;
}
/*
  CSS
____________________________________________________________________
*/
.css .property-list.end:after {
  content: "";
  display: block;
  width: 100%;
  height: 1px;
  border-bottom: 1px solid #1b1b22;
}
.css .selector {
  font-weight: 500;
}
.css .terminator {
  color: #ff9696 !important;
}
.css .entity.pseudo-element {
  color: #fa9664;
}
.css .entity.pseudo-class {
  color: #ff78dc;
}
.css .function {
  color: #349292;
  font-weight: 700;
}
.css .unit,
.css .entity {
  color: rgba(48, 147, 255, 0.8);
}
.css .tag {
  color: #c8c864;
}
.css .attribute {
  color: #b4b4b4;
}
.css .constant {
  color: #b4b4b4;
}
.css .constant.numeric {
  color: rgba(150, 200, 255, 0.8);
}
.css .constant.font-name,
.css .constant.color {
  color: rgba(233, 171, 255, 0.5);
}
.css .constant.color {
  font-weight: 100;
}
.css .unit {
  font-variant: small-caps;
}
.css .wildcard,
.css .id,
.css .important {
  color: #ff3030;
  font-weight: 700;
}
/*
  JSON
____________________________________________________________________
*/
.json .punctuation {
  font-weight: 700;
}
.json .punctuation.separator,
.json .punctuation.pair {
  color: #ff9696 !important;
}
.json .punctuation.key-value,
.json .punctuation.begin:not(.string),
.json .punctuation.end:not(.string) {
  color: rgba(48, 147, 255, 0.8) !important;
}
.json .string {
  color: #b4b4b4;
  font-weight: 500;
}
.json .string + .value .string {
  color: #64c864;
  font-weight: 100;
}
/*
  MARKDOWN
____________________________________________________________________
*/
.markup {
  font-weight: 100;
}
.markup.heading {
  color: #64c864;
  font-weight: 700;
}
.markup.heading-1 {
  font-size: 125%;
  line-height: 125%;
}
.markup.heading-2 {
  font-size: 120%;
  line-height: 120%;
}
.markup.heading-3 {
  font-size: 115%;
  line-height: 115%;
}
.markup.heading-4 {
  font-size: 110%;
  line-height: 110%;
}
.markup.heading-5 {
  font-size: 105%;
  line-height: 105%;
}
.markup.italic {
  color: rgba(99, 173, 255, 0.8);
  font-style: italic;
}
.markup.bold {
  color: rgba(150, 200, 255, 0.8);
  font-weight: 700;
}
.markup.underline {
  text-decoration: underline;
}
.markup.strike {
  color: rgba(220, 120, 255, 0.5);
  text-decoration: line-through;
}
.markup.link {
  color: #64c8c8;
}
.markup.code > .support,
.markup.raw {
  color: #c8c864;
}
.markup.raw {
  background-color: #09090b;
}
.gfm.mention + .string,
.gfm.mention {
  color: #fa9664;
}
.gfm.list {
  padding-right: 10px;
  color: #64c864;
  font-weight: 700;
  font-size: 110%;
  line-height: 110%;
}
.gfm.table .border {
  color: rgba(220, 120, 255, 0.5);
}
.gfm.hr:after {
  content: "";
  display: block;
  width: 100%;
  height: 2px;
  background-color: #414152;
}
.source.gfm > .comment.quote {
  padding-left: 35px;
  font-family: Verdana, Arial, sans-serif;
  font-size: 120%;
  line-height: 120%;
}
.source.gfm > .heading:after {
  content: "";
  display: block;
  opacity: 0.1;
  width: 50%;
  height: 1px;
  background-color: #64c864;
}
/*
  HTML
____________________________________________________________________
*/
.html.tag {
  color: #64c864;
}
.html.inline {
  color: #64c8c8;
}
.html.id {
  color: #fa9664;
}
.html.id.attribute-name {
  color: #ff78dc;
}
.html.comment {
  color: #414152;
}
/*
  ADJUSTMENTS
____________________________________________________________________
*/
.string .markup {
  color: rgba(220, 120, 255, 0.5);
}
/* Imports */
.import .keyword {
  color: rgba(220, 120, 255, 0.5);
}
.import .option {
  color: #b4b4b4;
}
.import .string,
.import .string .markup,
.import .storage {
  color: #c8c864;
}
